%liStyle
{
    font-size: $primary-font-size;
    font-weight: 600 ;
    color: $secondary-color-dark;
    text-transform: uppercase;
    transition: all 500ms ease-in-out;
    cursor: pointer;
}
%liHoverHeader
{
    content:'';
    position: absolute;
    width: 0;
    height: 2px;
    background-color: $primary-color;
    z-index: 1;
    top: 50%;
    right: 0;
    transform: translateX(-8px);
    opacity: 0;
    transition:opacity,width 500ms ease-in-out
}
%sec-col-4
{
    width: calc(100% / 4.4);
    margin-right: 1.8rem;
    &:last-of-type
    {
        margin-right: 0;
    }
    @include media('tab-land')
    {
        width: calc(100% /2.1);
        margin-bottom: 1rem;
        &:nth-of-type(2n)
        {
            margin-right: 0px;
        }
    }
    @include media('phone')
    {
        margin-bottom: 1rem;
        width: calc(100% /1);
        &:nth-of-type(n)
        {
            margin-right: 0px;
        }
    }
    @include media('bigDesktop')
    {
        width: calc(100% / 4.3);
    }
}
%sec-col-3
{
    width: calc(100% / 3.18);
    @extend %sec-col-4;
    @include media('bigDesktop')
    {
        width: calc(100% / 3.14);
    }
    @include media('tab-land')
    {
        width: calc(100% /2.1);
    }
    @include media('phone')
    {
        width: calc(100% /1);
    }   
}
%grid
{
    grid-gap: 30px;
    display: grid;
    @include media('tab-port')
    {
       grid-gap:0px;
    }
    @include media('small-phone')
    {
       display: block;
    }
}
%grid_1-2
{
    grid-column: 17/18;
    grid-row: 1/auto;
    @include media('tab-port')
    {
        grid-column: 1/18;
        grid-row: auto/auto;
        margin-right: 0;
    }
}
%grid_1-4
{
    grid-column: 1/17;
    grid-row: 1/auto;
    @include media('tab-port')
    {
        grid-column: 1/18;
        grid-row: auto/auto;
        margin-bottom: 3rem;
    }
}
%input
{
    background-color: $secondary-color-light;
    font: $primary-font;
    color:rgba($first-additional-color,0.5);
    border:1px solid rgba($first-additional-color,.2) ;
}
%placeholder
{
    color:rgba($first-additional-color,0.69);
    letter-spacing: .5px;
    text-transform: capitalize;
}

